import { styled } from "styled-components";

const Div = styled.div`
  position: relative;
`;

const A = styled.a`
  display: flex;
  align-items: center;
  margin-left: 30px;
`;

const Img = styled.img`
  width: 23px;
  height: 24px;
  margin-right: 5px;
`;

const SBMyMarket = () => {
  return (
    <div className="SBMyMarketDiv">
      <a>
        <img src="https://m.bunjang.co.kr/pc-static/resource/31370b164bc5b7cc4fef.png"></img>
        내상점
      </a>
    </div>
  );
};

export default SBMyMarket;
